export default (function(a,b,c,d,e,f,g,h,i){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:f,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:b,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:b,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:b,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:f,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:g,pageSize:25,pageCount:g,total:5}}},z6MoVzmd2B:{data:{id:2773,attributes:{imdbId:"tt6566576",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BNzQzYjIyZDQtMjBhZS00MzU3LTk0MTQtNTVmMDI3ZWY0ZWU3XkEyXkFqcGdeQXVyMTkxNjUyNQ@@._V1_SX300.jpg",type:b,ratings:[{Source:"Internet Movie Database",Value:"6.2\u002F10"},{Source:"Rotten Tomatoes",Value:"83%"},{Source:"Metacritic",Value:"67\u002F100"}],item_lang:{data:{id:3440,attributes:{title:"Fear Street: Part One - 1994",plot:"1994. In Shadyside, the murder capital of the United States, yet another brutal, unmotivated massacre sends shivers down the spine. And, more and more, the unholy name of Sarah Fier, a cursed local witch, keeps popping up. Now, something evil has awoken, forcing a team of five teenage friends to summon up the courage to get to the bottom of a bloody, centuries-old secret and fight tooth and nail against unstoppable supernatural forces to stay alive. But in this dangerous cat-and-mouse game, someone else makes the rules. Can the young defenders lift the town curse and end it all?",slug:"fear-street-part-one-1994"}}},books:{data:[{id:13176,attributes:{title:"Fear Street The Beginning",description:"The classic and heart-pounding Fear Street Series from beloved author R.L. Stine is back with the first four books now in one thrilling package! Welcome to Fear Street… Where strange things happen, people go missing, and nightmares come true. This is where it all began. When Fear Street became legend, forever linked with danger, and curses, and things that go bump in the night. Go back to how it all started—to the moment when Corey Brooks falls for perfect, incredible Anna, only to learn that she’s gone missing...on Fear Street. Venture into the terrifying Fear Street woods where Meg Dalton’s best friend Evan died under mysterious circumstances, and discover why only Meg can uncover the truth behind his death. Follow Della to Fear Island and learn about the terrifying threats that force Della to confront her past—and the incident that occurred on the island between her and a dangerous stranger. Return to Fear Street with Mark and Cara Burroughs who come home to find that their parents have disappeared, plunging them into a nightmare of chaos that neither of them could have ever predicted. The only thing they know for sure is that though Fear Street may be a mystery, not everyone escapes such an evil place alive. Only danger awaits those brave enough to travel down Fear Street. You’re not afraid…are you?",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=J1wJEAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:true,published:"2020-09-01",publisher:h,subtitle:"The New Girl; The Surprise Party; The Overnight; Missing"}},{id:13177,attributes:{title:"The Betrayal",description:"Nora knows the secrets behind the horrifying things happening on Fear Street and reveals the dark legacy that marked the start of the terror three hundred years earlier, when a young girl was burned at the stake.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=r5B2-wF-914C&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:c,published:"1993-08-01",publisher:h,subtitle:d}},{id:13178,attributes:{title:"The First Horror",description:"Fearing the tales surrounding Fear Street, twins Cally and Kody Frasier reluctantly move into the house their family has just bought, unaware that a evil secret haunts their new residence and threatens to claim them before it is discovered. Original.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=yRedko-52qMC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:c,published:"1994-08-01",publisher:e,subtitle:d}},{id:13179,attributes:{title:"The New Girl",description:"FEAR STREET -- WHERE YOUR WORST NIGHTMARES LIVE... The new girl is as pale as a ghost, blond, and eerily beautiful -- and she seems to need him as much as he wants her. Cory Brooks hungers for Anna Corwin's kisses, drowns in her light blue eyes. He can't get her out of his mind. He has been loosing sleep, ditching his friends...and everyone has noticed. Then as suddenly as she came to Shadyside High, Anna disappears. To find a cure for his obsession, Cory must go to Anna's house on Fear Street -- no matter what the consequences. Anna may be the love of his life...but finding out her secret might mean his death.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=wob5dX6t4R4C&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:c,published:i,publisher:e,subtitle:d}},{id:13180,attributes:{title:"The Burning",description:"Daniel and Nora, two young lovers from feuding families, must use their forbidden love to stop the awesome evil that stalks Nora and her family.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=9Z4-1tBikCoC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:c,published:i,publisher:e,subtitle:d}}]}}},meta:{}}},prerenderedAt:1681309101986}}("R.L. Stine","movie",false,"","Simon and Schuster","series",1,"Simon Pulse","2008-06-30"))